import { LOCALES } from "../locales";

export default {
  [LOCALES.ENGLISH]: {
    'Home': "Home",
    'About': "AboutUs",
    'Login': "LogIn",

    "hometext":"This is the Home page",
    "abouttext":"This is the About Us page",
    "logintext":"This is the Log In page",

    "genre":"Genre",
    "date":"Date",
    "rate":"Rating",

    "1": "The Gladiator",
    "2":"Donnie Darko",
    "3":"Alien vs Predator",
    "4":"Bleach the movie",
    "5":"The Fault in our stars",
    "6":"F&F:Tokyo Drift"
  },
};
